
def whitespace_decode(data):
    binary_code = data.replace(" ", "0").replace("\t", "1")
    binary_code = binary_code.replace("#", "00100000")  # Restore spaces
    binary_code = binary_code.replace("@", "00001010")  # Restore newlines
    return ''.join(chr(int(binary_code[i:i+8], 2)) for i in range(0, len(binary_code), 8))

